INSERT INTO `tomo` (`idTomo`, `cantidad_Tomo`, `Libro_idLibro`, `Descripcion`) VALUES
(1, 6, 1, 'DescripciónCien años de soledad es una novela del escritor colombiano Gabriel García Márquez, ganador del Premio Nobel de Literatura en 1982. Es considerada una obra maestra de la literatura hispanoamericana y universal'),
(3, 8, 3, 'Hasta el momento en que su padre decide suicidarse, la vida de Marcos parece normal. Va al colegio, lee novelas de aventuras, tiene su grupo de amigos, de vez en cuando le ayuda a su viejo en la tienda de barrio que les da de comer. Sin embargo, a partir de ese dÃ­a, Marcos debe convertirse en hombre y valerse por sÃ­ mismo. '),
(7, 8, 36, 'La novela arranca con un móvil apagado. Ester es la que llama; quien no responde, Giulio, que acaba de ser trasladado al hospital en estado grave a causa de un accidente en el kilómetro 123 de la Via Aurelia de Roma. Sin embargo, quien conectará el teléfono es Giuditta, la mujer de Giulio, quien lógicamente no sabe nada de Ester. Podría parecer el inicio de una comedia de enredo, pero nada más lejos de la realidad: un testigo afirma que el accidente de Giulio ha sido en realidad un intento de asesinato, por lo que la investigación será asignada al perspicaz inspector de la policía criminal Attilio Bongioanni, quien deberá enfrentarse a un caso en el que nada es lo que parece.\r\nUn thriller mu'),
(8, 10, 87, 'Una mañana, después de dejarle un mensaje en el contestador, el marido de Sara desaparece sin dejar rastro. Ella creía que Sigurd había quedado con unos amigos, pero ellos tampoco saben dónde está. Para Sara, Sigurd miente; para la policía, la experiencia de Sara como psicóloga la convierte en sospechosa. Pero, cuando los detectives descubren que la vida de Sara está siendo vigilada mediante cámaras y micrófonos ocultos, se dan cuenta de que ni la verdad es tan obvia, ni la mente tan poderosa.\r\n'),
(10, 9, 36, 'La novela arranca con un móvil apagado. Ester es la que llama; quien no responde, Giulio, que acaba de ser trasladado al hospital en estado grave a causa de un accidente en el kilómetro 123 de la Via Aurelia de Roma. Sin embargo, quien conectará el teléfono es Giuditta, la mujer de Giulio, quien lógicamente no sabe nada de Ester. Podría parecer el inicio de una comedia de enredo, pero nada más lejos de la realidad: un testigo afirma que el accidente de Giulio ha sido en realidad un intento de asesinato, por lo que la investigación será asignada al perspicaz inspector de la policía criminal Attilio Bongioanni, quien deberá enfrentarse a un caso en el que nada es lo que parece.\r\nUn thriller mu'),
(17, 8, 17, 'n septiembre de 1940, mientras las bombas alemanas caen sobre Gran Bretaña, la joven Susan y su abuelo Bertie hallan consuelo criando y entrenando palomas mensajeras que el Ejército usará para transmitir información sobre los movimientos de los nazis en la Francia ocupada.\r\n\r\nA miles de kilómetros, en Estados Unidos, un joven piloto llamado Ollie decide unirse a la RAF, la Real Fuerza Aérea británica, entrando así en contacto con el Servicio Nacional de Palomas, donde conoce a Susan. Tras hacerse inseparables, ambos serán seleccionados para formar parte de una misión secreta que puede llevar al país a la victoria. Sin embargo, cuando el avión de Ollie es derribado en líneas enemigas, Susan s'),
(32, 15, 33, 'Un majestuoso landó avanza en dirección a la imponente finca de los Marqués. Con tan solo siete años, la pequeña Josefa entra a trabajar como sirvienta en la casa, incapaz de imaginar cómo su presencia cambiará para siempre la historia de dos poderosas familias. \r\n\r\nTreinta años más tarde los Marqués se ven abocados a huir de su casa y abandonar su más que acomodada posición social. No serán los únicos, pues los Sagnier habrán de exiliarse y otros, como Antonio, pobre pero idealista, intentará dar un giro a la sociedad. Todos ellos, defendiendo sus ideales, son ajenos al caprichoso destino que los une mediante un poderoso lazo y un asombroso secreto.\r\n\r\nBarcelona, San Sebastián, Madrid, Gijó'),
(78, 20, 86, 'En 1954, el joven psiquiatra Germán Velázquez vuelve a España para trabajar en el manicomio de mujeres de Ciempozuelos, al sur de Madrid. Tras salir al exilio en 1939, ha vivido quince años en Suiza, acogido por la familia del doctor Goldstein. En Ciempozuelos, Germán se reencuentra con Aurora Rodríguez Carballeira, una parricida paranoica, inteligentísima, que le fascinó a los trece años, y conoce a una auxiliar de enfermería, María Castejón, a la que doña Aurora enseñó a leer y a escribir cuando era una niña. Germán, atraído por María, no entiende el rechazo de ésta, y sospecha que su vida esconde muchos secretos. El lector descubrirá su origen modesto como nieta del jardinero del manicomi');

